Text:
@giggedguy;
That's a load of nonsense. I've been using XP x64 for ages now, and never had one iota of a problem finding drivers for it. 99% of all hardware is fully supported. Besides, the Windows server 2003 is such a heavily backed Server OS by so many companies that it will be a cold day in hell when a manufacturer decides NOT to develop drivers for XP x64 and 2003 x64.

Don't believe the hype! It works fine. Just not THIS version. I would try a more recent XP x64 here on piratebay.
